import actions from './action';
import jwt_decode from 'jwt-decode'
import $ from 'jquery'

const reducer = (state = {
  user: {
    username: "",
    id: 1,
    photo: "",
    followCount: 0,
    access: "",
    refresh: "",
    is_login: false,
  }
}, action) => {
  switch(action.type) {
    case actions.UPDATEACCESS:
      return {
        ...state,
        user: {
          username:"dsfas"
        }
      }
    default:
      return state;
  }
}

export default reducer
